import './App.css';
import * as React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Page1 from './admin/adpage1';
function App() {
  return (
    <Router>
      <Routes>
        <Route path='/admin/adpage1' element={<Page1/>}
        />
      </Routes>
    </Router>
  );
}

export default App;
